  if (!data) return null;

  return (
    <div className="callflow-container">
          {onBack && (
        <button
          className="btn btn-sm btn-outline-secondary mb-2"
          onClick={onBack}
        >
          ‚Üê Back
        </button>
      )}
      <CallFlowGraph data={data} />
    </div>
  );
}

export default CallFlowView;
